html {
    height: 100%;
    -webkit-font-smoothing: antialiased;
}

body {
    line-height: 1;
    font-family: "font", "default-font", sans-serif;
    width: 100%;
    margin: 0;
    overflow: hidden;
}

.item {
    display: flex;
    flex-wrap: wrap;
    flex-direction: row;
    align-items: center;
    align-content: center;
    justify-content: center;
    position: relative;
}

.dotted-demo .item::before{
    border: dashed 0.1px rgb(255 255 255 / 50%);
    content: "";
    position: absolute;
    width: 100%;
    transform: scale(0.99);
    height: 100%;
    pointer-events: none;
}

.dotted-demo .item::before:hover{
    border: dashed 0.1px rgb(255 255 255 / 50%);
    content: "";
    position: absolute;
    width: 100%;
    transform: scale(0.99);
    height: 100%;
    pointer-events: none;
}

.video{
    width: 100%;
    height: 100%;
    pointer-events: none;
}

.audio-wrap{display: none}

.sprite-image, .text, .video, .disable{ pointer-events: none; }

video::-webkit-media-controls {
 display: none !important; 
}
video::-webkit-media-controls-start-playback-button {
    display: none !important; 
}
video::-webkit-media-controls-panel {
display: none !important;}

video::-webkit-media-controls-overlay-play-button {
  display: none !important;
}

.seq-images, .seq-images .frame{
    position: absolute;
    width: 100%;
    height: 100%;
    left: 0;
    top: 0;
    pointer-events: none;
}

.seq-images .frame{
    background-position: center;
    background-repeat: no-repeat;
    background-size: cover;
    opacity: 0;
}

.seq-images .frame.frame-0{ opacity: 1 }

@keyframes sprite_animation {
  from {
    background-position: left;
  }
  to {
    background-position: right;
  }
}

.hide {
  opacity: 0 !important;
  animation: none !important;
  pointer-events: none;
}

.pre_hide {
  opacity: 0 !important;
  transition: opacity 0.05s;
}

.disable {
  pointer-events: none;
}

.animAll{
    transition: all 0.3s ease-in;
}

    </div>
    <script>
document.addEventListener("DOMContentLoaded", function(event) {
            
    let isAutoplayWrap = document.querySelector(".video-autoplay") 
    let isAutoplay = isAutoplayWrap !== undefined && isAutoplayWrap !== null && !isAutoplayWrap.classList.contains('hide')
    
    // window.addEventListener("focus", handleBrowserState, false);
    window.addEventListener("blur", handlePauseSounds , false);
    
    let sounds = document.querySelectorAll("audio")
    let videos = document.querySelectorAll("video")

    function handlePauseSounds(){
        sounds.forEach((sound) => {
            if(!sound.paused){
                sound.pause();
            }
        })
    }
   
    function startScript(){
        
        
document.querySelector("#start_screen").classList.remove('disable'); interact('#first_banner', "tap", function (event) { if(event.target.id === 'first_banner'){document.querySelector("#video_video").play(); setTimeout(function(){document.querySelector("#end-reward").classList.add('pre_hide'); document.querySelector("#end-reward").classList.remove('hide'); setTimeout(()=>{
          document.querySelector("#end-reward").classList.remove('pre_hide');
        }, 50); interact('#end-reward-btn', "tap", function (event) { if(event.target.id === 'end-reward-btn'){document.querySelector("#end-reward").classList.add('hide'); document.querySelector("#video").classList.add('hide'); callToAction(); location.href = "uniwebview://action?key=close"; 
} }); 
 }, 5000); 
setTimeout(()=>{document.querySelector("#video").classList.add('pre_hide'); document.querySelector("#video").classList.remove('hide'); setTimeout(()=>{
          document.querySelector("#video").classList.remove('pre_hide');
        }, 50); }, 50); 
        } }); 

        if (isAutoplay) { 
            videos.forEach((video) => {
                if(!video.classList.contains('video-autoplay')){
                    video.load();
                }
            })
            sounds.forEach((sound) => {
                if(!sound.paused){
                    sound.load();
                }
            })
            isAutoplayWrap.play()
        }
    }
            
  function callToAction(){
    let sounds = document.querySelectorAll('audio')
    sounds.forEach(sound => {sound.pause()})
    
    console.log('Call to Action'); 
    }
            




            
function animAll(id, duration){
    document.querySelector('#' + id).classList.add('animAll')
    setTimeout(function(){
        document.querySelector('#' + id).classList.remove('animAll')
    }, duration)
}

function isTouch(){
    var prefixes = ["-webkit-", "-moz-", "-o-", "-ms-"];
    var mq = function (query) {
         window.matchMedia(query).matches;
    };
    if (('ontouchstart' in window) || window.DocumentTouch && document instanceof DocumentTouch) {
        return true;
    }
    var query = ['(', prefixes.join('touch-enabled),('), 'heartz', ')'].join('');
    return mq(query);
 }

            
            
function interact(container, type, func) {
  let wrap = document.querySelector(container)
  switch (type) {
    case "tap":
        if(isTouch()){
            wrap.addEventListener("touchend", func);
        } else {
            wrap.addEventListener("click", func);
        }
      break;
    default:
      break;
  }
}
            startScript(); });
    </script>
